<?phpnamespace Nemundo\Meteo\Eumetsat\Data\ImageType;class ImageTypePaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var ImageTypeModel*/public $model;public function __construct() {parent::__construct();$this->model = new ImageTypeModel();}/*** @return ImageTypeRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new ImageTypeRow($dataRow, $this->model);$list[] = $row;}return $list;}}